      out.write("\r\n");
      out.write("    //그리드 저장 함수\r\n");
      out.write("    function save_grid1_onclick(){\r\n");
      out.write("        // 추가된 행 아이템들(배열)\r\n");
      out.write("        let addedRowItems = AUIGrid.getAddedRowItems(grid1);\r\n");
      out.write("        // 수정된 행 아이템들(배열) : 수정된 필드와 수정안된 필드 모두를 얻음.\r\n");
      out.write("        let editedRowItems = AUIGrid.getEditedRowItems(grid1);\r\n");
      out.write("\r\n");
      out.write("        //검증\r\n");
      out.write("        let itemCount = addedRowItems.length + editedRowItems.length;\r\n");
      out.write("        if(itemCount == 0){\r\n");
      out.write("            alert(\"변경된 항목이 없습니다\");\r\n");
      out.write("            return;\r\n");
      out.write("        }\r\n");
      out.write("        if(itemCount > 100){\r\n");
      out.write("            alert(\"변경사항 저장은 최대 100건까지만 가능합니다. (현재 \" + itemCount + \"건)\");\r\n");
      out.write("            return;\r\n");
      out.write("        }\r\n");
      out.write("        if(!confirm(\"총 \" + itemCount + \"건의 변경사항을 저장하시겠습니까?\")) return;\r\n");
      out.write("        if(!requireCheck(\"SAVE_GRID1\")) return;\r\n");
