      out.write("        let l_grid1Data = AUIGrid.getGridData(grid1);\r\n");
      out.write("        let l_rowCount1 = AUIGrid.getRowCount(grid1);\r\n");
      out.write("        for(var i=0; i < l_rowCount1; i++){\r\n");
      out.write("            if(AUIGrid.isAddedById(grid1, l_grid1Data[i][\"_$uid\"])  == true\r\n");
